import React from 'react';
import "../styles/Confirm.css";

const Confirm = ({player_name}) => {
    return(
        <div id="confirm">
            <div className='text'>Вы уверены, что хотите удалить игока: {player_name}?</div>
            <button className='done-btn'>Да, удалить</button>
            <button className='cancel-btn'>Нет</button>
        </div>
    )
}

export default Confirm;
